import React from 'react'
import '../../assets/styles/button.scss'
const Button = (props) => {
    return(
       <div className="buttonclass">
            <button type="submit" className={`btn ${props.className}`} >
            {props.buttonName}
        </button>
       </div>
    )
}
export default Button
